const styles: Styles<any, any> = () => ({
    container: {
        width: "100%",
        textAlign: "center",
        "& input": {
            fontFamily: "inherit",
            color: "#3F3F48",
        },
    },
    grayText: {
        color: "#D0D2D9",
    },
});

class BridgeSelect extends React.PureComponent<any> {
    ref: React.RefObject<any>;
    input: any;

    constructor(props: any) {
        super(props);
        this.ref = React.createRef();
        this.input = null;
    }

    componentDidMount() {
        const inputRef = this.props.inputRef;
        if (this.props.inputRef) {
            this.ref = inputRef;
        }

        if (this.input) {
            this.input.focus();
        }
    }

